--WAF config file,enable = "on",disable = "off"

--waf status
config_waf_enable = "on"
--log dir
config_log_dir = "/var/logs/nginx"
--rule setting
config_rule_dir = "/usr/local/openresty/nginx/conf/waf/rule-config"
--enable/disable white url
config_white_url_check = "on"
--enable/disable white ip
config_white_ip_check = "on"
--enable/disable block ip
config_black_ip_check = "on"
--enable/disable url filtering
config_url_check = "on"
--enalbe/disable url args filtering
config_url_args_check = "on"
--enable/disable user agent filtering
config_user_agent_check = "on"
--enable/disable cookie deny filtering
config_cookie_check = "on"
--enable/disable cc filtering
config_cc_check = "on"
--cc rate the xxx of xxx seconds
config_cc_rate = "10/60"
--enable/disable post filtering
config_post_check = "on"
--config waf output redirect/html
config_waf_output = "html"
--if config_waf_output ,setting url
config_waf_redirect_url = "/"
config_output_html=[[
<!doctype html>
<html lang="zh-cmn-Hans">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=640, user-scalable=no, target-densitydpi=device-dpi">
    <meta name="format-detection" content="telephone=no">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-status-bar-style" content="black">
    <title>Web应用防火墙(TEC)</title>
    <style>
        body{ background: #fafafa; font: 14px/1 Arial,'Microsoft YaHei',\5B8B\4F53;}
        .error { width: 640px; margin: 0 auto; padding-top: 110px; text-align: center; }
        .error p { padding-top: 0px; color: #999; }
        .error .text-b { color: #88a2b3; font-size: 30px; }
		.p_tip { font-size: 20px; }
    </style>
</head>
<body>
    <div class="error">
        <img src="data:image/png;base64," />
        <p class="text-b">Web应用防火墙(TEC)</p>
        <p class="p_tip">该系统正受Web应用防火墙安全防护，由于您使用的请求方法存在潜在的安全风险，已被防火墙拦截。如有疑问，请火星联系14120反馈。</p>
    </div>
</body>
</html>
]]

